import React, { useEffect } from 'react';
import MainBar from './MainBar';

function Dashboard({ toggleSidebar }) {
  // You don't need to maintain isSidebarOpen state in this component.

  useEffect(() => {
    // Call the toggleSidebar function passed from the parent component
    toggleSidebar();
  }, [toggleSidebar]);

  return (
    <div>
      <MainBar />
    </div>
  );
}

export default Dashboard;
